import './App.css';
import HomePage from "../src/pages/HomePage"
import { Route, Routes } from 'react-router-dom'


function App() {
  return (
    <div className="App">
        <Routes>
          <Route path="/create" element={<HomePage />} />
        </Routes>
    </div>
  );
}

export default App;
